description:
How to Avoid Mistakes in Surgery

Health-Medical Documentary hosted by Kevin Fong, published by BBC broadcasted as part of BBC Horizon series in 2013 - English narration


Information
------------------------------

A&amp;E doctor Kevin Fong finds out how doctors can avoid making mistakes in the high-pressure, high-stakes world of the operating theatre. He sets out to learn how other professionals make life and death decisions under pressure, from airline pilots facing emergencies, to the Fire Service dealing with lethal blazes, to the world of Formula One pit crews. Kevin discovers how all these fields are helping to make surgery safer.

